import { Line } from 'react-chartjs-2';

export default function StockChart({ dates, actual, predicted }) {
    const data = {
        labels: dates,
        datasets: [
            { label: "Actual", data: actual, borderColor: "blue" },
            { label: "Predicted", data: predicted, borderColor: "red" }
        ]
    };
    return <Line data={data} />;
}
